import React, { Component } from 'react'

 class Jokes extends Component {
    render() {
        return(
            <div className="container">
                <div className="row">
                    <div className="col-md-12 jumbotron text-center">
                        <h1>Jokes</h1>
                    </div>
                </div>

            </div>
        );
    }
}


export default Jokes;
